import React, {useState} from 'react';
import '../App.css';


function TavernPublish() {

    const [items, setItems] = useState([]);
    setItems(window.localStorage.getItem('TavenItems'));



    return (
        <div>
            <h1 className='title'>Tavern</h1>
            <div className='itemsContainer'>
                {items.map(item => (
                    <h1 className='items' key={item.url}>
                        <span className='itemNames' >{item.name}</span>
                    </h1>
                ))}
            </div>
        </div>
    );
}




export default TavernPublish;
